import { Grid, TextField } from '@material-ui/core';
import React from 'react';

const InputForm = () => {
    return ( 
        <form>
            <Grid container>
                <Grid item xs={6}>
                <TextField  type="text" variant="outlined"/>
                <TextField  type="text" variant="outlined"/>
                </Grid>
                <Grid item xs={6}>
                <TextField  type="text" variant="outlined"/>
                <TextField  type="text" variant="outlined"/>
                </Grid>
                <Grid item xs={6}>
                <TextField  type="text" variant="outlined"/>
                <TextField  type="text" variant="outlined"/>
                </Grid>
            </Grid>
        </form>
     );
}

export default InputForm;
